import img from "./image/b2.jpg"
import Cards from "./cards"
import DataApi from "./DataApi"


const App = () => {

  return (
    <>
     <div className="main_div">
       <div className="center_div">
  
{
  DataApi.map((crnVal)=>{
    return(
      <>
      <Cards imgSrc={crnVal.img}
  title={crnVal.title}
  pera={crnVal.p}
/> 
      </>
    )
  })
}
  
       </div>
     </div>
    </>
  )
}

export default App
